create table fs_items (
    id bigint not null primary key,
    item_type smallint not null,
    parent bigint,
    users_id integer not null,

    directory varchar not null,
    basename varchar not null,

    created timestamp with time zone not null,
    modified timestamp with time zone,

    user_data json,

    is_root boolean not null default false,

    constraint perent_fk foreign key (parent) references fs_items (id)
)





with recursive dir_tree as (
    select fs_root.id,
           fs_root.item_type,
           fs_root.parent,
           fs_root.users_id,
           fs_root.directory,
           fs_root.basename,
           1 as level
    from fs_items fs_root
    where id = 388

    union

    select fs_contents.id,
           fs_contents.item_type,
           fs_contents.parent,
           fs_contents.users_id,
           fs_contents.directory,
           fs_contents.basename,
           dir_tree.level + 1 as level
    from fs_items fs_contents
    inner join dir_tree on dir_tree.id = fs_contents.parent
)
select * 
from dir_tree
order by level desc,
         parent,
         item_type,
         basename;